import { Outlet } from "react-router-dom";
import Navbar from "./Navbar";

function MainLayout() {
  return (
    <div style={{ display: "flex" }}>
      <div style={{ flex: 1 }}>
        <Navbar />
        <div style={{ padding: 20 }}>
          <Outlet />
        </div>
      </div>
    </div>
  );
}

export default MainLayout;
